import React from 'react';
import ReactDOM from 'react-dom/client';
import Button from 'react-bootstrap/Button'

import 'bootstrap/dist/css/bootstrap.min.css';
import './index.css';

class CreateRoomButton extends React.Component {


	componentDidMount() {
		console.log('rendered for the first time!');
	}

	render() {
	  return (
		<div className= "index-btn create-room-btn">
			<Button variant="primary" size="lg">Create Room</Button>{' '}
		</div>
	);
	}

}

class JoinRoomButton extends React.Component {

	componentDidMount() {
		console.log('rendered for the first time join room.!');
	}

	render() {
          return (
		<div className= "index-btn join-room-btn">
			<Button variant="success" size="lg">Join Room</Button>{' '}
		</div>
		)	

	}
}


function App() {
	return (
		<div className= "index-btns">
			<CreateRoomButton />
			<JoinRoomButton />
		</div>
	);

}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
